import React, { useEffect, useState } from "react";
import { Select, Divider, Collapse, Form, Button, Row, Col, Card, Input, DatePicker, TimePicker } from 'antd';
import { PlusOutlined, MinusCircleOutlined } from "@ant-design/icons";
import { useSelector } from "react-redux";
import { useHistory, useLocation } from "react-router";
import ConfirmationModal from "components/Modal/ConfirmationModal";
import ENUMS from "constants/appEnums";

export default function TrackingSheet(props) {
    const { Option } = Select;
    const { Panel } = Collapse;
    const { TextArea } = Input;
    const history = useHistory();
    const location = useLocation();
    const pathName = location.search;

    const projectIds = useSelector(state => state.authReducer.userProjectIds);
    const initialProppantFormValues =  { proppantData: [{ description: null, specific_gravity: null, bulk_density: null }] }
    const [items, setItems] = useState(['Stage 1']);
    const [showConfirmationModal, setShowConfirmationModal] = useState();
    const [modalData, setModalData] = useState();

    const [dynamicFormNestItemValues, setDynamicFormNestItemValues] = useState({
        bht_f: undefined,
        bht_psi: undefined,
        customer: "a",
        date: undefined,
        event_occur: undefined,
        field_engineer_days: undefined,
        field_engineer_nights: undefined,
        frac_design: undefined,
        plug_seat_technique: undefined,
        plug_type: undefined,
        seismos_data_collection: undefined,
        stage: 1,
    })

    const [perforationIntervalInformationValues, setPerforationIntervalInformationValues] = useState({
        acid: undefined,
        bottom_perf: undefined,
        clusters_number: undefined,
        displacement_vol_bottom: undefined,
        displacement_vol_plug: undefined,
        displacement_vol_top: undefined,
        diverter_type: undefined,
        perf_daiameter: undefined,
        perf_gun_desc: undefined,
        plug_depth: undefined,
        pumped_diverter: undefined,
        spf: undefined,
        top_perf: "a"
    })

    const [stageDataValues, setStageDataValues] = useState({
        Acid_volume_gals: undefined,
        Flush_volume_bbls: undefined,
        Max_prop_Conc_ppa: undefined,
        Slurry_volume_bbls: undefined,
        Total_lbs: undefined,
        Total_clean_fluid_volume_bbls: undefined,
        Total_pad_volume_bbls: undefined,
        Total_sand_lbs: undefined,
        base_fluid_density: undefined,
        base_fluid_type: undefined,
        isip: undefined,
        last_bbls: undefined,
        last_description: undefined,
        last_ppg: undefined,
        max_conc_density: undefined,
        opening_well: undefined,
        second_bbls: undefined,
        second_description: undefined,
        second_ppg: undefined,
        stage_end_time: undefined,
        stage_start_time: "a",
        third_bbls: undefined,
        third_description: undefined,
    })

    const [propantFormValues, setPropantFormValues] = useState({
        proppantData: [
            {
                bulk_density: null,
                description: "a",
                specific_gravity: null,
            }
        ]
    })

    const [activeDataFormValues, setActiveDataFormValues] = useState({
        amplitude: undefined,
        frequency: undefined,
        number_of_pulses: undefined,
        offset: undefined,
        periods: undefined,
        post_end_time: undefined,
        post_start_time: undefined,
        pre_end_time: undefined,
        pre_start_time: undefined,
    })

    const [notesFataFormValues, setNotesFataFormValues] = useState({
        other_notes: undefined,
        pre_notes: "a",
        post_notes: "a"
    })


    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const addStage = () => {
        setShowConfirmationModal(true);
    }

    const handleAddStageConfirmed = (data) => {
        addItem();
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const onFormSubmit = (values) => {
        console.log(values);
    };

    const dynamicFormNestItemChange = (x, y) => {
        console.log('dynamicFormNestItemChange: ', x, y)
    }

    const perforationIntervalInformationChange = (x, y) => {
        console.log('perforationIntervalInformationChange: ', x, y)
    }

    const stageDataChange = (x, y) => {
        console.log('stageDataChange: ', x, y)
    }

    const propantFormChange = (x, y) => {
        console.log('propantFormChange: ', x, y)
    }

    const activeDataFormChange = (x, y) => {
        console.log('activeDataFormChange: ', x, y)
    }

    const notesFataFormChange = (x, y) => {
        console.log('notesFataFormChange: ', x, y)
    }


    const onDateChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const showAddItemModal = () => {

    }

    const addItem = () => {
        setItems([...items, `Stage ${items.length + 1} (Added)`])
    };

    useState(() => {
        // const wellId = history.location.pathname.split("/admin/")[1].split("/")[1];
        // const well = project.wellInfoValues.find(well => well.id == wellId);
        // console.log(well);
