                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'frequency'}
                                            label="Freq [Hz]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'offset'}
